@victoriamonet “Party Girls”

Transparency moment… I’ve had a weird relationship with dance for a couple years now that almost felt like a toxic relationship lol. There’s been a lot of times that  I’ve questioned myself or questioned my love for dance because it felt like the fun and passion was sucked out because of the things I’ve been through in this industry. Turns out it was me. I lost myself. And I’m still fighting to get back to me but I’m happy to say I see the light at the end of the tunnel now. And I go into class trying to be better again and not just going to do the steps with no intention behind it. It feels good again finally ❤️

