@vmas w @dojacat !! Once again late with the postings but doesn’t make me any less grateful. 
I’m thankful beyond measure to be back on the stage with such a creative team!! This is another level of artistry. Thank you Doja for your talent is out of this world, you are a lyrical genius and I am always honored to be dancing on stage with you. I can’t wait for your new album to drop because I know they gonna be looking!! 😉
@ebonywilliamsworld , thank you and I’m humbled that you believed in my ability to bring this production to fruition along side such talented dancers. Your story telling in your choreography is brilliant and inspiring. You and Ardyn are truly a dream team, it was a pleasure to go into rehearsals because you created an atmosphere of comfort, creativity, learning and inspiration. 
And @ardundundun you mf rockstar I am in awe of your talent all around.. your leadership and kindness just adds to the amazing person you are. Thank you so much for all you do!
To all the dancers….we did that!! Such a freaking honor to come to a new city and connect with dope dancers who double as great people as well. I appreciate sharing the stage with y’all!🫶🏼

